import React from "react";

function Numbers(){
    return(
        <div className="container-numbers">
            <div>1</div>
            <div>2</div>
            <div>3</div>
            <div>4</div>
            <div>5</div>
            <div>6</div>
            <div>7</div>
            <div>8</div>
            <div>9</div>
      
        </div>
        
    )
}

export default Numbers;
